import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const name = "chitranjan";
  const sayHello  = true;
  const showMath  = true;
  const num1  =40;
  const num2=30;


  let math;
  if( showMath ){
    math  = <h1>{num1}+{num2}={ num1+num3 }</h1>
  }else{
    math  = null;
  }

  return (
    <div className="App">
      <h1>The App component</h1>
      { sayHello ?<h4>{name}</h4>:null }
      { math }
    </div>
  );
}

export default App;
